import React from 'react';
import {connect} from "react-redux";
import {withRouter} from "react-router-dom"
import {compose} from "redux";
import {newItem} from "../../../Redux/later-seen-reducer";
import AllOrder from "./AllOrder";


class AllOrderContainer extends React.Component {


    render() {

        return (
            <AllOrder pizza={this.props.pizza} number={this.props.match.params.id - 1}
                        size={this.props.size} ves={this.props.ves} newItem={this.props.newItem} sous={this.props.sous}
                        sneks={this.props.sneks} drink={this.props.drink}/>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        pizza: state.pizzaPage.pizza,
        size: state.pizzaPage.siza,
        ves: state.pizzaPage.ves,
        sous: state.sousPage.sous,
        sneks: state.sneksPage.sneks,
        drink: state.drinkPage.drink,


    }


}

export default compose(
    connect(mapStateToprops, {newItem}),
    withRouter,
)(AllOrderContainer)
